B.LQ=new A.hF("My name is Rylan Reaper. I come from a small Texas farming town called Dawson, graduating high school as Valedictorian of my class. I was typically kept busy, participating in a myriad of activities like: Football, Baseball, Track, Powerlifting, FFA, One Act Play, among other academic events for UIL. Elaborating on FFA, as it was the organization which I contributed much of my time, I raised show animals like goats, shared the scientific wonder hydroponics through competive Public Speaking, even acting as Vice President of the District, traveling across Texas during the summer to organize and lead camps. After graduating college, I went to Texas A&M University to study Computer Science, learning hard and fast how technologically ignorant I was at the time. I also got the privilage to join the Texas A&M Paranormal Society (TAPS) during only its second semester of operation, getting to act as itsComm/Tech Manager and even its Vice President over my years at A&M. I share all of this because...",null,B.Ld,null,null)
B.LR=new A.hF("I first learned about the computer software known as Blender when I was in high school, around 2015. Speaking frankly, it was likely around the time the popular web series RWBY was growing in popularity on YouTube. Up to that point, I had only really been exposed to 2D handdrawn animation, and for some reason, the idea of crafting characters and objects in 3D space, to model, pose, and animate, seemed to work better for my brain. Now, I also enjoy 2D art. 3D art just seems to make more sense to me. Unfortunately, while in college, I didn't really have the time to learn Blender, being an almost comically unfriendly software to start. Finally, in 2022, fresh out of college, I got my first 3D printer, a classic Creality Ender 3 V2, I installed Blender, and I didn't stop. Now, I am printing full-sized fantasy and anime swords by request.",null,B.eE,B.eC,null)
